use 5.014;
use warnings;

#Code to determine start positions of pattern #Note: end can be determined by start+ pattern length
$_ = "
";#"
#";

# $_ = '
# ';#'GATATATGCATATACTT';#'ATGCGCATGC';#
my $length_input = length $_;

my $pattern = 'CTTCGTCCT';#'CTTGATCAT';
my $length_pattern = length $pattern;

say $length_input, "\t", $length_pattern;


my $i = 0;
my @posn =();


while ($i< $length_input){
	# #say "Aa";
	 my $substr = substr $_, $i, $length_pattern;
	 my $found = index  $_,$substr,$i;
	 #say "YABBA :$found";	
	  push @posn, $found if $substr =~ /$pattern/;
			
	 $i++
 }

 #say "MEOW :@posn";
 open OUT, ">Output_pattern_positions.out" or die $!;
 say OUT "@posn";
 